import React,{Component} from "react";
import Children from "./Children";
import "./App.css"

class App extends Component {
  constructor(){
    super();
    this.state = { 
      arr:[
        {
          f_name:"reda", l_name:"eskouni", age:26, date:new Date(), 
          email:"redaEskouni@gmail.com", 
          user_name:"RedaEskouni",
        },
        {
          f_name :"adil", l_name :"eskouni", age:25, date:new Date(),
          email :"adilEskouni@gmail.com",
          user_name:"adilEskouni00",
        },
      ]
    }
  }  

  render(){
    const info = this.state.arr.map(e => <Children 
      f_name={this.e.f_name} 
      l_name={this.e.l_name} 
      age={e.age}
      date={e.date}
      email={e.email}
      user_name={e.user_name}
    />)

    return (
      <div className="App">
          {info}
      </div>
    );
  }
}

export default App;
